import React, { useState } from 'react';
import { Home, Users, UserPlus, Upload, AlertTriangle, Menu, X } from 'lucide-react';
import Dashboard from './components/Dashboard';
import UngroupedMembers from './components/UngroupedMembers';
import GroupCards from './components/GroupCards';
import ImportExport from './components/ImportExport';
import { useMembers } from './hooks/useMembers';

type ViewType = 'dashboard' | 'ungrouped' | 'groups' | 'import' | 'alerts';

function App() {
  const [currentView, setCurrentView] = useState<ViewType>('dashboard');
  const [sidebarOpen, setSidebarOpen] = useState(false);

  const {
    members,
    groups,
    ungroupedMembers,
    dashboardStats,
    loading,
    error,
    assignMemberToGroup,
    removeMemberFromGroup,
    createGroup,
    updateMember,
    importMembers
  } = useMembers();

  const navigation = [
    { id: 'dashboard', name: 'Dashboard', icon: Home, current: currentView === 'dashboard' },
    { id: 'ungrouped', name: 'Assign Members', icon: UserPlus, current: currentView === 'ungrouped', badge: ungroupedMembers.length },
    { id: 'groups', name: 'Groups', icon: Users, current: currentView === 'groups' },
    { id: 'import', name: 'Import/Export', icon: Upload, current: currentView === 'import' },
    { id: 'alerts', name: 'Alerts', icon: AlertTriangle, current: currentView === 'alerts', badge: dashboardStats.alerts.length },
  ];

  const handleNavClick = (viewId: ViewType) => {
    setCurrentView(viewId);
    setSidebarOpen(false);
  };

  const renderAlerts = () => (
    <div className="space-y-6">
      <div className="bg-white rounded-lg shadow-sm border border-gray-200 p-6">
        <h2 className="text-xl font-semibold text-gray-900">Group Alerts</h2>
        <p className="text-gray-600 mt-1">
          {dashboardStats.alerts.length} alert{dashboardStats.alerts.length !== 1 ? 's' : ''} requiring attention
        </p>
      </div>

      {dashboardStats.alerts.length === 0 ? (
        <div className="bg-white rounded-lg shadow-sm border border-gray-200 p-12 text-center">
          <AlertTriangle className="h-12 w-12 text-green-500 mx-auto mb-4" />
          <h3 className="text-lg font-medium text-gray-900 mb-2">No alerts!</h3>
          <p className="text-gray-600">All groups are well-balanced.</p>
        </div>
      ) : (
        <div className="space-y-4">
          {dashboardStats.alerts.map((alert, index) => (
            <div
              key={`${alert.groupId}-${index}`}
              className={`bg-white rounded-lg shadow-sm border p-6 ${
                alert.severity === 'high' ? 'border-red-200' :
                alert.severity === 'medium' ? 'border-orange-200' :
                'border-yellow-200'
              }`}
            >
              <div className="flex items-start justify-between">
                <div className="flex-1">
                  <div className="flex items-center">
                    <h3 className="text-lg font-semibold text-gray-900">{alert.groupName}</h3>
                    <span className={`ml-3 px-2 py-1 text-xs font-medium rounded-full capitalize ${
                      alert.severity === 'high' ? 'bg-red-100 text-red-800' :
                      alert.severity === 'medium' ? 'bg-orange-100 text-orange-800' :
                      'bg-yellow-100 text-yellow-800'
                    }`}>
                      {alert.severity}
                    </span>
                  </div>
                  <p className="text-gray-600 mt-2">{alert.description}</p>
                  <div className="mt-3">
                    <p className="text-sm font-medium text-gray-700">Affected members:</p>
                    <p className="text-sm text-gray-600">{alert.affectedMembers.join(', ')}</p>
                  </div>
                </div>
                <button
                  onClick={() => setCurrentView('groups')}
                  className="ml-4 bg-primary-600 text-white px-4 py-2 rounded-md text-sm font-medium hover:bg-primary-700 transition-colors"
                >
                  View Group
                </button>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );

  const renderContent = () => {
    if (loading) {
      return (
        <div className="flex items-center justify-center h-64">
          <div className="animate-spin rounded-full h-32 w-32 border-b-2 border-primary-600"></div>
        </div>
      );
    }

    if (error) {
      return (
        <div className="bg-red-50 border border-red-200 rounded-lg p-6">
          <h3 className="text-lg font-medium text-red-900">Error loading data</h3>
          <p className="text-red-700 mt-2">{error}</p>
        </div>
      );
    }

    switch (currentView) {
      case 'dashboard':
        return (
          <Dashboard
            stats={dashboardStats}
            onViewUngrouped={() => setCurrentView('ungrouped')}
            onViewAlerts={() => setCurrentView('alerts')}
          />
        );
      case 'ungrouped':
        return (
          <UngroupedMembers
            ungroupedMembers={ungroupedMembers}
            groups={groups}
            onAssignMember={assignMemberToGroup}
            onCreateGroup={createGroup}
          />
        );
      case 'groups':
        return (
          <GroupCards
            groups={groups}
            onRemoveMember={removeMemberFromGroup}
            onUpdateGroup={() => {}}
          />
        );
      case 'import':
        return (
          <ImportExport
            groups={groups}
            ungroupedMembers={ungroupedMembers}
            onImportMembers={importMembers}
          />
        );
      case 'alerts':
        return renderAlerts();
      default:
        return null;
    }
  };

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Mobile sidebar */}
      <div className={`fixed inset-0 z-40 lg:hidden ${sidebarOpen ? '' : 'hidden'}`}>
        <div className="fixed inset-0 bg-gray-600 bg-opacity-75" onClick={() => setSidebarOpen(false)} />
        <div className="relative flex-1 flex flex-col max-w-xs w-full bg-white">
          <div className="absolute top-0 right-0 -mr-12 pt-2">
            <button
              onClick={() => setSidebarOpen(false)}
              className="ml-1 flex items-center justify-center h-10 w-10 rounded-full focus:outline-none focus:ring-2 focus:ring-inset focus:ring-white"
            >
              <X className="h-6 w-6 text-white" />
            </button>
          </div>
          <div className="flex-1 h-0 pt-5 pb-4 overflow-y-auto">
            <div className="flex-shrink-0 flex items-center px-4">
              <h1 className="text-xl font-bold text-gray-900">Freeda Admin</h1>
            </div>
            <nav className="mt-5 px-2 space-y-1">
              {navigation.map((item) => (
                <button
                  key={item.id}
                  onClick={() => handleNavClick(item.id as ViewType)}
                  className={`group flex items-center px-2 py-2 text-base font-medium rounded-md w-full text-left ${
                    item.current
                      ? 'bg-primary-100 text-primary-900'
                      : 'text-gray-600 hover:bg-gray-50 hover:text-gray-900'
                  }`}
                >
                  <item.icon className="mr-4 h-6 w-6" />
                  {item.name}
                  {item.badge && item.badge > 0 && (
                    <span className="ml-auto bg-red-100 text-red-600 py-0.5 px-2.5 rounded-full text-xs font-medium">
                      {item.badge}
                    </span>
                  )}
                </button>
              ))}
            </nav>
          </div>
        </div>
      </div>

      {/* Desktop sidebar */}
      <div className="hidden lg:flex lg:w-64 lg:flex-col lg:fixed lg:inset-y-0">
        <div className="flex-1 flex flex-col min-h-0 bg-white border-r border-gray-200">
          <div className="flex-1 flex flex-col pt-5 pb-4 overflow-y-auto">
            <div className="flex items-center flex-shrink-0 px-4">
              <h1 className="text-xl font-bold text-gray-900">Freeda Admin</h1>
            </div>
            <nav className="mt-5 flex-1 px-2 space-y-1">
              {navigation.map((item) => (
                <button
                  key={item.id}
                  onClick={() => handleNavClick(item.id as ViewType)}
                  className={`group flex items-center px-2 py-2 text-sm font-medium rounded-md w-full text-left ${
                    item.current
                      ? 'bg-primary-100 text-primary-900'
                      : 'text-gray-600 hover:bg-gray-50 hover:text-gray-900'
                  }`}
                >
                  <item.icon className="mr-3 h-5 w-5" />
                  {item.name}
                  {item.badge && item.badge > 0 && (
                    <span className="ml-auto bg-red-100 text-red-600 py-0.5 px-2.5 rounded-full text-xs font-medium">
                      {item.badge}
                    </span>
                  )}
                </button>
              ))}
            </nav>
          </div>
        </div>
      </div>

      {/* Main content */}
      <div className="lg:pl-64 flex flex-col flex-1">
        <div className="sticky top-0 z-10 lg:hidden pl-1 pt-1 sm:pl-3 sm:pt-3 bg-gray-50">
          <button
            onClick={() => setSidebarOpen(true)}
            className="-ml-0.5 -mt-0.5 h-12 w-12 inline-flex items-center justify-center rounded-md text-gray-500 hover:text-gray-900 focus:outline-none focus:ring-2 focus:ring-inset focus:ring-indigo-500"
          >
            <Menu className="h-6 w-6" />
          </button>
        </div>
        <main className="flex-1">
          <div className="py-6">
            <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
              {renderContent()}
            </div>
          </div>
        </main>
      </div>
    </div>
  );
}

export default App;
